import React, { useState } from 'react'

export const MenuBar = ({ pages }) => {

    return (
        <div className='menuBar'>
            <ul>{
                pages.map(page => {
                    <input 
                        key={page.id}
                        type='button' 
                        text={page.name}    
                    />
                })
            }</ul>
        </div>
    );
}
